sys_variable_value.value:
(function execute(inputs, outputs) {
  try {
    var successStatusCodes = ['201'];
    var errorMessages = {
      'Project Not Found': 'Invalid Project ID.',
      'A file with this name already exists': 'Invalid file name: already exists.',
      'can only create or edit files when you are on a branch': 'Invalid branch: does not exist.',
    };
    var callbackFunction = function(inputs, outputs, errorMessages) {
      var responseBody = JSON.parse(inputs.responseBody);
      outputs.file_path = responseBody.file_path;
      outputs.branch = responseBody.branch;
      return outputs;
    };
    outputs = new x_snc_gitlab.GitLabUtils().postProcess(inputs, outputs, errorMessages, successStatusCodes, callbackFunction);
  } catch (e) {
    outputs = new x_snc_gitlab.GitLabErrorHandler(e).handleError(inputs, outputs, errorMessages);
  }
})(inputs, outputs);

